import React from "react";
import Card from "../Card/Card";

function Cards({ countries }) {
    if (!countries || countries.length === 0) {
        return <div>No countries available.</div>;
    }
    
    return (
        <div>
            {
                countries.map(({ id, name, flag, continent  }) => {
                    return (
                        <Card
                            key={id}
                            id={id}
                            name={name}
                            flag={flag}
                            continent={continent}
                        />
                    )
                })
            }
        </div>
    )
}

export default Cards;
